import {Link} from 'react-router-dom'

import styles from './Navbar.module.css'

import Logo from '../../assets/img/techpeoplel_logo.png'

function Navbar() {
    return (
        <nav className={styles.navbar}>
            <div>
                <img src={Logo} alt="TechPeople" />
            </div>
        </nav>
    );
  }

export default Navbar
